import Styles from "./ItemsList.module.css";
import Items from "./Items/Items";

class ItemsList extends Component {
    state = {
        itemList: [
            {
            nutrition:null,
            name: "Cheese",
            amount:{    
                amount:100,
                units:"g"
                }
            },
            {
            nutrition:null,
            name: "Salt",
            amount:{   
                amount:1,
                units:"spoons"
                }
            },
            {
            nutrition:null,
            name: "Egg",
            amount: {
                amount:1,
                units:null
                }
            }
        ]
    } 

    render(){
        return(
            <div className={Styles.ItemsList}>
                <span>Plus </span><input type="text" placeholder="search bar"/>
                <hr/>
                <Items items={this.state.ItemsList}/>
            </div>
        )
    }
}

export default ItemsList;
